import axios from "axios";
import React, { useEffect, useState } from "react";

function Home(props) {
  const [data, setData] = useState([]);
  const [search, setSearch] = useState([]);
  const fetchApi = async () => {
    const data = await axios.get(
      "https://youtube.googleapis.com/youtube/v3/videos?part=player&chart=mostPopular&maxWidth=200&key=AIzaSyDGfgHu5xMnVzAtjs1bYgWGYYUF6yA8dXg"
    );
    setData(
      data.data.items.map((e) => "https://www.youtube.com/embed/" + e.id)
    );
    console.log(data.data)

    //  setData(data.data.items[0].player.embedHtml)
  };
  const searchApi = async (e) => {

    const key = await axios.get(
      "https://youtube.googleapis.com/youtube/v3/search?part=snippet&maxResults=5&q="+
        {search}+
        "&key=AIzaSyDGfgHu5xMnVzAtjs1bYgWGYYUF6yA8dXg"
    );
    console.log(key.data);
  };

  useEffect(() => {
    fetchApi();
    searchApi();
  }, []);

  return (
    <div>
      <h1>Youtube Website</h1>
      <h4>Search</h4>
      <input
        type="text"
        value={search}
        onChange={(e) =>   setSearch(e.target.value),searchApi()}
      />

      <div className="continer">
        {data.map((e, i) => (
          <div key={i}>
            <iframe
              width="400"
              height="213"
              src={e}
              frameBorder="0"
              allow="accelerometer; autoplay; 
              clipboard-write; encrypted-media; gyroscope;
              picture-in-picture"
              allowFullScreen
            ></iframe>
          </div>
        ))}

      </div>
    </div>
  );
}

export default Home;
